import React, { useState, useEffect } from 'react';
import WebViewer3D from './WebViewer3D';

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('https://webapi.partcommunity.com/service/table/vertical?apikey=e66120f9d9624823884cac1bf290ea88&language=english&eol=1&plm=true&includeunclassifiedbycountry=false&enablePreviewPerLine=true&path=bosch_rexroth_cytro/power_units/std_power_units/cytropac_asmtab.prj&includecrossref=true');
        const result = await response.json();
        setData(result);
      } catch (error) {
        console.error('Error fetching the data', error);
      }
    };

    fetchData();
  }, []);

  if (!data) {
    return <div>Loading...</div>;
  }
  const indexPath = data.index.line.values
  const cnsordernoValue = indexPath.CNSORDERNO.values[0].value;
  const mnValue = indexPath.MN.values[0].name;
  const typeValue = indexPath.TYP.values[0].name;
  const csValue = indexPath.CS.values[0].name;
  const tsValue = indexPath.TS.values[0].name;
  const drValues = indexPath.DR.values.map(item => item.name);
  const pcValues = indexPath.PC.values.map(item => item.name);
  const pmValues = indexPath.PM.values.map(item => item.name);
  const opValue = indexPath.OP.values[0].name;
  const stValues = indexPath.ST.values.map(item => item.name);
  const ctValues = indexPath.CT.values.map(item => item.name);
  const flValue = indexPath.FL.values[0].name;
  const colValue = indexPath.COL.values[0].name;
  const fdValues = indexPath.FD.values.map(item => item.name);

  return (
    <div>
      <p>Order Number: {cnsordernoValue}</p>
      <p>Material Number: {mnValue}</p>
      <p>Type: {typeValue}</p>
      <p>Component series: {csValue}</p>
      <p>Tank size: {tsValue}</p>
      <form>
      <label>Drive:</label>
      <select>
        {drValues.map((value, index) => (
              <option key={index}>{value}</option>
            ))}
      </select>
      </form>
      <br></br>
      <form>
      <label>Performance Class:</label>
      <select>
      {pcValues.map((value, index) => (
              <option key={index}>{value}</option>
            ))}
      </select>
      </form>
      <br></br>
      <form>
      <label>Pump Design:</label>
      <select>
      {pmValues.map((value, index) => (
              <option key={index}>{value}</option>
            ))}
      </select>
      </form>
      <p>Operating Pressure: {opValue}</p>
      <form>
      <label>Sensor Technology:</label>
      <select>
      {stValues.map((value, index) => (
              <option key={index}>{value}</option>
            ))}
      </select>
      </form>
      <br></br>
      <form>
      <label>Cooling type / maximum cooling power fluid:</label>
      <select>
      {ctValues.map((value, index) => (
              <option key={index}>{value}</option>
            ))}
      </select>
      </form>
      <p>Filling: {flValue}</p>
      <p>Coloring: {colValue}</p>
      <form>
      <label>Further Details:</label>
      <select>
      {fdValues.map((value, index) => (
              <option key={index}>{value}</option>
            ))}
      </select>
      </form>
      <h1>WebViewer3D Demo</h1>
            <WebViewer3D />
    </div>

  );
}

export default App;
